create multiset table uat_product.SALES_MIX_BACKUP as 	(		select *	from UAT_PRODUCT.PRODUCT_PARAMETERS	where param_1 = 'SM Plan'		)with no dataprimary index(report_date, param_1, branch_id, tariff_1);	insert into uat_product.SALES_MIX_BACKUP	select * 	from UAT_PRODUCT.PRODUCT_PARAMETERS	where param_1 = 'SM Plan'		with name_report as (		 sel            case when name_report in ('Классический','Мой разговор','Мой Tele2','Мой онлайн','Мой онлайн+','Безлимит') then name_report                when name_report in ('Везде онлайн','Везде онлайн+') then 'Везде онлайн'             	else 'Other'            end as name_report,            min(tp_id) as tp_id        from PRD2_DIC_V.PRICE_PLAN        group by 1        )sel 	distinct name_report.name_reportfrom UAT_PRODUCT.PRODUCT_PARAMETERS ppleft join name_report	on pp.tp_id_1 = name_report.tp_idWHERE param_1 = 'SM Plan'